import React from "react";

import "./style.css"

const CityList = ( props ) =>{

    const { citys } = props.data

    console.log( citys )

    return(
    <div>
        <h3>热门城市</h3>
            <ul>
                {citys.map((el,index,array)=>{
                    return(<li key={index}>
                        <span>{el.name}</span>
                    </li> )
                })}
            </ul>
    </div>
    )
}

export default CityList
